import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { styBtnNavigation } from './style';

const Button = ({ text, link, type }) => {
  switch (type) {
    case 'link':
      return (
        <Link className={styBtnNavigation} to={link}>
          {text}
        </Link>
      );

      break;

    default:
      break;
  }
};

export default Button;
